class AuthRepo {

     constructor(){
         this.apiEndpoint = "http://localhost:8080";



         this.login = this.apiEndpoint+'/users/login';
         this.signup = this.apiEndpoint+'/users/signup';
         this.contacts = this.apiEndpoint+'/contacts/all';
     }


}


export default AuthRepo;
